import Accordion from '@zyxui/accordion'

# Accordion Component

An `Accordion` is a web component that allows users to expand or collapse content sections to save space and simplify navigation.


## Installation

Ensure that have the @zyxui library installed in your project:
<Example>
```bash
npm install @zyxui/accordion
```
</Example>

If you haven't install and setup @zyxui before please follow the [`installation guide`](/docs/installation)


## Basic Accordion

To create a basic accordion, simply write this code below:

<Example>
    <Preview>
        <Accordion
            defaultValues={['0']}
            items={[
                {
                    id: 0,
                    title: "Item One",
                    content: <p>This is content of Item One</p>
                },
                {
                    id: 1,
                    title: "Item Two",
                    content: <p>This is content of Item Two</p>
                }
            ]}
        />
    </Preview>

