## API Reference

| Property            | Description                               | Type        | Default     |
| --------------------|-------------------------------------------|-------------|-------------|
| items | Accordion items | `{id: number \| string; title: string; content: ReactNode}[]` | `[]` |
| variant | Change accordion base styles. | `default` \| `bordered` | `default` |
| size | Accordion size. | `ms` \| `md` \| `lg` | `md` |
| multiple | Multiple openable items. | `boolean` | `false` |
| iconPosition | Change accordion icon position. | `start` \| `end` | `end` |
| className | Adding custom class names to your accordion. | `string` | `undefined` |
